import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import { FaBehance, FaDribbble, FaInstagram } from "react-icons/fa";
import Portfolio from "./Portfolio";
import About from "./About";
import Services from "./Services";
import Works from "./Works";
import Contact from "./Contact";

export default function App() {
  return (
    <Router>
      <div className="flex min-h-screen bg-white text-black">
        {/* Sidebar */}
        <aside className="w-1/4 p-8 bg-black text-white flex flex-col justify-between">
          <div>
            <h1 className="text-3xl font-bold">Chiranjeevi</h1>
            <nav className="mt-6">
              {[
                { name: "Home", path: "/" },
                { name: "About", path: "/about" },
                { name: "Services", path: "/services" },
                { name: "Works", path: "/works" },
                { name: "Blogs", path: "/blogs" },
                { name: "Contact", path: "/contact" },
              ].map((item) => (
                <Link key={item.name} to={item.path} className="text-gray-400 hover:text-white block mb-4">
                  {item.name}
                </Link>
              ))}
            </nav>
          </div>
          <div className="flex gap-4">
            <FaBehance size={24} />
            <FaDribbble size={24} />
            <FaInstagram size={24} />
          </div>
          <p className="text-gray-500 text-sm">Â©2023 Jacob Jones. All rights reserved.</p>
        </aside>

        {/* Dynamic Page Content */}
        <main className="w-3/4 p-16">
          <Routes>
            <Route path="/" element={<Portfolio />} />
            <Route path="/about" element={<About />} />
            <Route path="/services" element={<Services/>} />
            <Route path="/works" element={<Works />} /> 
          </Routes>
        </main>
      </div>
    </Router>
  );
}
